import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import SettingsResetPage from './components/settings/SettingsResetPage';
import SettingsChangePage from './components/settings/SettingsChangePage';
import BaseLayout from './elements/BaseLayout';

import './normalize.css';
import './global.css';
import './headings.css';

if (window.location.pathname === '/') {
  window.location.replace('/reset');
}

const App = () => (
  <Router>
    <Switch>
      <BaseLayout>
        <Route path="/reset" component={SettingsResetPage} />
        <Route path="/change" component={SettingsChangePage} />
      </BaseLayout>
    </Switch>
  </Router>
);

export default App;
